import React from "react";
//import styles from "semantic-ui-css/semantic.min.css";
const WomanDetail = ({ displayedWoman }) => {
  return (
    <div className="ui items">
      <div className="item">
        <div className="image">
          <img src={displayedWoman.img_src} />
        </div>
        <div className="content">
          <a className="header">{displayedWoman.name}</a>
          <div className="meta">
            <span>Description</span>
          </div>
          <div className="description">
            <p>sadfashfd</p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default WomanDetail;
